import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../pages-css/Home.css'; // Adjust the import path as per your project structure
import MedgptIcon from '../assets/Medgpt_icon.png';

function Home() {
  const navigate = useNavigate();

  return (
    <div className="home-container"> {/* Applied the home-container class here */}
      <button className="button" onClick={() => navigate('/input')}>Start</button> {/* Applied the button class here */}
      <button className="button" onClick={() => navigate('/records')}>Records</button> {/* Applied the button class here */}
    </div>
  );
}

export default Home;
